import React from "react";
import { GoogleMap,LoadScript, Marker } from '@react-google-maps/api';
function Map(){
    const style = {
        width : '2000px',
        height : '700px'
    };
    const center = {
        lat : 37.55480,
        lng : 126.98297
    };

    const point = [
        {lat : 37.57510, lng : 126.92690},
        {lat : 37.58626, lng : 126.98528},
        {lat : 37.56115, lng : 127.03845},
        {lat : 37.53469, lng : 126.97581},
        {lat : 37.56125, lng : 126.98868},
    ];
    point.map((value)=>{
        console.log(value);
    })
    return (
        <div className="map">
            <LoadScript googleMapsApiKey="AIzaSyDevvetng60XedeOqk-qW9TF-XBNQsyxdE">
                <GoogleMap
                    mapContainerStyle={style}
                    center={center}
                    zoom={12}
                >
                    {
                        point.map((value)=>{
                            <Marker position={value}/>
                        })
                    }
                </GoogleMap>
            </LoadScript>
        </div>
    );
}

export default Map;
